    "title": "Dead Fox - Courtney Barnett",
    "description": "Taken from the LP: \"Sometimes I Sit And Think, And Sometimes I Just Sit\" - out through Milk! Records, Marathon Artists, and Mom+Pop\nDirected and animated By Rory Kerr and Paul Ruttledge -  https://vimeo.com/user11664735\n\nOrder \"Sometimes I Sit And Think, And Sometimes I Just Sit\": http://www.courtneybarnett.com.au\niTunes: http://po.st/sometimesisit\n\nListen:\nhttp://po.st/SpotifyCB\n\nJoin the Milk! Records mailing list for all the latest on Courtney Barnett http://www.milkrecords.com.au\n\nFollow:\nhttp://po.st/FacebookCB\nhttp://po.st/TwitterCB\nhttp://po.st/InstagramCB\n\nDEAD FOX was written by Courtney Barnett\n\nJen insists that we buy organic vegetables and I must admit that I was a little skeptical at first; a little pesticide canâ€™t hurt? \nNever having too much money I get the cheap stuff at the supermarket, but theyâ€™re all pumped up with shit,\nA friend told me that they stick nicotine in the apples.\n\nIf you canâ€™t see me I canâ€™t see you\n\nHeading down the Highway Hume somewhere at the end of June. \nTaxidermied kangaroos are littered on the shoulders. A possum Jackson Pollock is painted on the tar. \nSometimes I think a single sneeze could be the end of us, my hay-fever is turning up, just swerved into a passing truck. \nBig business overtaking, without indicating; he passes on the right, been driving through the night to bring us the best price.\n\nIf you canâ€™t see me I canâ€™t see you.\n\nMore people die on the road than they do in the ocean, maybe we should mull over culling cars instead of sharks \n(or just lock them up in parks where we can go and view them). \nThereâ€™s a bypass over Holbrook now, paid for with burgers no doubt, Iâ€™ve lost count of all the cows. \nThereâ€™ll be no salad sandwiches. The law of averages says weâ€™ll stop in the next town where petrol price is down (what do I know anyhow?)\n\nIf you canâ€™t see me I canâ€™t see you.",
