    "title": "Run The Jewels feat. Zack de la Rocha - \"Close Your Eyes (And Count To F**k)\"",
    "description": "Subscribe to Mass Appeal: http://goo.gl/LqG3wZ\nBuy RTJ2 on iTunes:â€‹ â€‹http://found.ee/rtj2\n\n\"When Run The Jewels sent me this track, I knew we had the opportunity to create a film that means something. I felt a sense of responsibility to do just that. We had to exploit the lyrics and aggression and emotion of the track, and translate that into a film that would ignite a valuable and productive conversation about racially motivated violence in this country. It's provocative, and we all knew this, so we were tasked with making something that expressed the intensity of senseless violence without eclipsing our humanity. For me, it was important to write a story that didnâ€™t paint a simplistic portrait of the characters of the Cop and Kid. They're not stereotypes. They're people - complex, real people and, as such, the power had to shift between them at certain points throughout the story. The film begins and it feels like they have been fighting for days, theyâ€™re exhausted, not a single punch is thrown, their violence is communicated through clumsy, raw emotion. They've already fought their way past their judgments and learned hatred toward one another.  Our goal was to highlight the futility of the violence, not celebrate it.â€\n \nFor El-P of Run the Jewels â€œthis is a vision of a seemingly never-ending struggle whose participants are pitted against each other by forces originating outside of themselves.â€ \n \nAdds partner Killer Mike \"this video represents the futile and exhausting existence of a purgatory-like law enforcement system. There is no neat solution at the end because there is no neat solution in the real world. However, there is an opportunity to dialogue and change the way communities are policed in this country. Salutes to AG Rojas for his unique take on the subject matter and to Shea and Keith for giving us their all and bringing it to life.\"\n\nDIRECTED BY A.G. ROJAS\nPRODUCED BY PARK PICTURES\n\nUPCOMING TOUR DATES:\n04/10 - Coachella\n04/17 - Coachella\n05/09 - Big Guava Fest, Ft. Lauderdale FL\n05/23 - Boston Calling Music Festival 2015, Boston, MA\n05/29 - Primavera Sound, Barcelona, Spain \n06/06 - Field Day 2015 - London UK\n06/07 - The Forum - London, UK\n06/12 - Bonnaroo Music Festival 2015, Manchester TN\n07/05 - ATP Iceland 2015 - Keflavik, Iceland\n08/11-08/15 - Oya Festival 2015 - Oslo, Norway\n08/14 - Flow Festival 2015 - Helsinki, Finland\n08/28- Reading Festival 2015 - Reading, UK\n08/29 - Leeds Festival, Wetherby, UK \n\n--------------Run The Jewels--------------\nhttp://www.runthejewels.net/\nhttps://twitter.com/therealelp\nhttps://twitter.com/KillerMikeGTO\nhttps://twitter.com/runjewels\nhttps://instagram.com/KillerMikeGTO\nhttps://instagram.com/thereallyrealelp\n\n--------------Mass Appeal Records--------------\nWebsite: http://massappealrecords.com\nTwitter: http://twitter.com/massappealrecs\nInstagram: http://instagram.com/massappealrecs\nFacebook: http://facebook.com/massappealrecs",
